description:
The Try Guys Try Podcasting! On our first episode Keith decides he wants to produce his own sex tape, and the guys answer some first date questions at the weirdest restaurant ever.
New Episodes of the TryPod come out every Thursday. Rate, subscribe, and tell us a secret in the comments so we can read them on a future episode!
